import './App.css';
import React, {useEffect, useState} from 'react';

function App() {
  const [shades, setShades] = useState([]);

  useEffect(() => {
    fetch("http://localhost:9292/shades")
      .then((response) => response.json())
      .then((data) => {
        setShades(data);
        console.log(data)
      });
  }, []);


  return (
    <div className="App">
    {shades.map}
    </div>
  );
}

export default App;
